function getHardwareItemDeviceName(identifier) {
  switch (identifier) {
    case 'ExpansionHub2AsVoltageSensor':
      return 'Expansion Hub 2';
    case 'ExpansionHub2asLynxModule':
      return 'Expansion Hub 2';
    case 'color1asLynxI2cColorRangeSensor':
      return 'color1';
    case 'imuAsBNO055IMU':
      return 'imu';
    case 'left':
      return 'left';
    case 'right':
      return 'right';
    case 'touch1':
      return 'touch1';
  }
  throw  'Unexpected identifier (' + identifier + ').';
}

